import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="emoji" alt="logo" />
        <p>
        &#x1F603
          Welcome to your tamagotchi
        </p>

      </header>
    </div>
  );
}

export default App;
